import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  componentDidMount(){
    fetch('http://localhost:3001/workouts')
    .then(res => res.json())
    .then(workouts => console.log(workouts))
  }


  render() {
    return (
      <h1>hello</h1>
    );
  }
}

export default App;
